import { ExportTestDef } from "./_export-test-def.js";
import * as AbstractImage from "../../../index.js";

const svgEncoded = ``;

const binaryImage = AbstractImage.createBinaryImage(
  AbstractImage.createPoint(0, 0),
  AbstractImage.createPoint(400, 400),
  "svg",
  { type: "bytes", bytes: Buffer.from(svgEncoded, "base64") }
);
const abstractImage = AbstractImage.createAbstractImage(
  AbstractImage.createPoint(0, 0),
  AbstractImage.createSize(400, 400),
  AbstractImage.white,
  [binaryImage]
);

const svg = AbstractImage.createSVG(abstractImage);
/*eslint-disable no-useless-escape */
export const testSvgBinary: ExportTestDef = {
  name: "svg binary",
  abstractImage: svg,
  expectedImage: `<svg xmlns="http://www.w3.org/2000/svg" width="400px" height="400px" viewBox="0 0 400 400"><image x="0" y="0" width="400" height="400" href="data:image/svg+xml;base64,${svgEncoded}"></image></svg>`,
};
